import React from 'react'
import '../assets/css/Buttonpersion.css'

const ButtonPermision = () => {
    return (
        <div class="d-flex justify-content-center">
            <button type="button" class="buttonpermision">Grand Permision</button>
        </div>
    );
}

export default ButtonPermision;
